import React from 'react'
import AddtoCart from "../AddtoCart/AddtoCart.jsx"
import Axios from "axios"
// import image from "./addtocart.jpeg"

import "./Modal.css"

export const ModalDialogue = ({closeModal}) => {

const getNewOrder = () =>{
  Axios.delete("http://localhost:3001/AddtoCart")
  // localStorage.setItem("cartVal",dish.res_name)
  console.log("Deleted!");
}


    return(
      <>
      <div className="modalBackground" id="myModal">
      <div className="modalContainer" style={{backgroundColor:"black",color:"white"}}>
        <div className="titleCloseBtn">
        <button type="button" onClick={()=>{closeModal(false)}}>x</button>
        </div>
        <div className="title">
        <h5 style={{color:"white"}}>Create a New Order?</h5>
        </div>
        <div className="body">
          <h2>Your order contains items from ${(localStorage.getItem("cartVal"))}, Do you want to create a new order?</h2>
        </div>
        <div className="footer" style={{color:"white"}}>
          <button type="button" id="cancelBtn" className="btn btn-success" style={{borderRadius:"50px",fontSize:"0.8rem"}} onClick={()=>{closeModal(false)}}>Cancel</button>
        <button type="button" className="btn btn-success btn-md" style={{borderRadius:"50px",fontSize:"0.8rem"}} onClick={getNewOrder}>Continue</button>
        </div>
        </div>
      </div>

      </>
)
  };
